#region ScriptHeader
using System;
using Altaxo;
using Altaxo.Calc;
using Altaxo.Data;
namespace Altaxo.Calc
{
	public class FunctionEvaluationScript : Altaxo.Calc.FunctionEvaluationScriptBase
	{
		public override double EvaluateFunctionValue(double x)
		{
            #endregion
            // ----- add your script below this line -----

            var param = new double[] {3000, 1000, 150, 4500, 1500, 150, 2000, 2000, 150 };
            var fit = new Altaxo.Calc.FitFunctions.Peaks.GaussAmplitude(3, -1);
            var X = new double[1];
            var Y = new double[1];

            X[0] = x;
            fit.Evaluate(X, param, Y);

            return Y[0];

			// ----- add your script above this line -----
#region ScriptFooter
		} // method
	} // class
} //namespace
#endregion
